import React from "react";
function add(a,b){
    return a+b
}
function sub(a,b){
    return a-b
}
function mul(a,b){
    return a*b
}
function div(a,b){
    let ans = a/b
    return ans.toFixed(2)
}

export default add 
export {sub, mul, div}
